% dimensions
D=0.02155;
r=D/2;
h=0.070155;
m=0.07;
V=pi*r^2*h;
SA=2*pi*(r^2)+2*pi*(r^2)*h;
rho = m/V;   % density, kg/m^3
% specs
V_nominal=3.6;
R_i=0.015;
%test conditions
I=10;    %choose a discharge current, A
T_ambient=25+273.15;
T_0=T_ambient;
   %NOW SEE BELOW convective heat transfer coefficient (cfd?) (???)
% thermo
C_p=1040;   % specific heat, J/kg*K (???)
k_r=0.9;  %thermal conductivity (???)
k_theta=k_r;    %angle symmetry
k_z=24.2;    % (???)
q=(I^2)*(R_i)/V; %volumetric heat generation, W/m^3

%pde, transient thermal model -> rhoC_p(partialT/partialt)=grad dot
%(kgradT) + q

thermalmodel = createpde('thermal','transient');
thermalmodel.Geometry = multicylinder(r, h);
figure; pdegplot(thermalmodel); %[output:4c76775a]
allfaces=1:thermalmodel.Geometry.NumFaces;
hmax=0.0025;
generateMesh(thermalmodel, 'Hmax',hmax);
figure; pdemesh(thermalmodel) %[output:9d763efe]
k=[k_r;k_theta;k_z];
% Define thermal properties
thermalProperties(thermalmodel, 'ThermalConductivity',k,'MassDensity',q,'SpecificHeat',C_p);
internalHeatSource(thermalmodel, q);
% define boundary/initial conditions (could define these after the ftn too)
thermalBC(thermalmodel, "Face",allfaces,"HeatFlux",@(region,state) h_flux(region, state, T_ambient, h_min, h_max));
    % don't use T_ambient bc it's included in q_flux (HeatFlux) eq already
    % this is calling a ftn (when you have (region, state), call h_flux)
thermalIC(thermalmodel,T_0);    

% h_conv as a ftn of radial distance from x-axis (assuming airflow coming
% in from x-axis)
h_min = 10;
h_max = 30;

% defining the ftn (headline & body) -- gives names of inputs, calling
% passes actual input values to these names
function q_flux = h_flux(region, state, T_ambient, h_min, h_max) %output=ftn name(inputs in order)
    T_local = state.u.';
    theta = atan2(region.x, region.y);
    h_conv = h_min + (h_max - h_min).*((1+cos(theta))/2);   %.* means element-wise multiplication
    q_flux = (h_conv * (T_local - T_ambient)).';
end

% Solve the transient thermal model
tlist = 0:5:3600; % time vector
result = solve(thermalmodel, tlist);
T_f=result.Temperature(:,end);

%%
%visualize
figure; %[output:3bd5ddac]
pdeplot3D(thermalmodel,"ColorMapData",T_f-273.15) %[output:3bd5ddac]
title(sprintf("Heat distribution at I=10 A after 3600s, 25Â°C ambient T")) %[output:3bd5ddac]
colorbar; %[output:3bd5ddac]
%%
%graph
d_x=linspace(0,r,100);
d_y=zeros(size(linspace(0,r,100)));
d_z=ones(size(linspace(0,r,100)))*(h/2);

T_radial=zeros(100, length(tlist));
for i=1:length(tlist)
    T_radial(:,i) = interpolateTemperature(result, d_x, d_y, d_z, i);
end

figure; %[output:5658d96f]
surf(tlist,d_x,T_radial) %[output:5658d96f]
xlabel(sprintf("Time (s)")) %[output:5658d96f]
ylabel(sprintf("Distance from center axis (m)")) %[output:5658d96f]
zlabel(sprintf("Temperature (K)")) %[output:5658d96f]





















